    false,nt"url": null,nt"notes": "NCEI Accession 0145857 includes physical
    and underway data collected aboard the ROBERT GORDON SPROUL during cruise SP1520
    in the North Pacific Ocean from 2015-09-20 to 2015-09-22. These data include CURRENT
    SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT (V). The
    instruments used to collect these data include ADCP and GPS. These data were collected
    by Jules Jaffe of University of California - San Diego; Scripps Institution of Oceanography
    as part of Continued Development of a Laser Line Scan Lidar System. The Lamont-Doherty
    Earth Observatory (LDEO) submitted these data to NCEI as part of the NSF sponsored
    Rolling Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
    processed data set. Post processed quality assessed data are not available in this
